INSERT INTO users VALUES('2024-12-03 10:57:00.624Z','kevin.ganthy@gmail.com',1,'3netq8zpui5bp5f','','','','Ganthy','$2a$12$G5Mh81OEC6PWg8MOjCIlz.NtiXp4Jf1O8ibyTC6cT6NFIPyu1Pzvu','YCCx0FvMnHlSKDtx8UQsxxdedwcHLhXPK08I4EtPwTJ3OdCJx2','2024-12-03 13:09:52.618Z','kevin',0,'Kévin','Ingénieur pédagogique','Développeur polyvalent','06 68 28 51 97','Charente-Maritime','https://www.linkedin.com/in/k%C3%A9vin-ganthy/','https://github.com/kevinganthy?tab=repositories','<p>Curieux et autonome, j&rsquo;ai une grande capacit&eacute; &agrave; r&eacute;soudre des probl&egrave;mes. Je suis capable d&rsquo;intervenir sur n&rsquo;importe quelle stack technique, tout en respectant les bonnes pratiques en termes de collaboration et de qualit&eacute; de code.<br><br>Adepte des tests et de l&rsquo;automatisation, j&rsquo;aime l&rsquo;approche DevOps CI/CD. Aucun de mes projets ne fonctionne sans Docker et son pipeline de d&eacute;ploiement.<br><br>Je repousse constamment mes limites pour am&eacute;liorer ma productivit&eacute; et &eacute;largir mes comp&eacute;tences techniques.</p>');
