INSERT INTO jobs VALUES('2024-12-03 11:03:53.871Z',replace(replace('<p>Initialement recrut&eacute; comme formateur PHP, j&rsquo;ai chang&eacute; plusieurs fois de poste pour r&eacute;pondre aux besoins internes. Du plus r&eacute;cent au plus ancien :</p>\r\n<ul>\r\n<li>Ing&eacute;nieur p&eacute;dagogique depuis septembre 2024</li>\r\n<li>Ing&eacute;nieur p&eacute;dagogique &agrave; 50% et coordinateur de formateurs externes &agrave; 50 % pendant 1 an</li>\r\n<li>Ing&eacute;nieur p&eacute;dagogique &agrave; 50% et formateur full-stack &agrave; 50% pendant 4 mois</li>\r\n<li>Formateur full-stack pendant 1 an</li>\r\n</ul>\r\n<p>En tant qu&rsquo;ing&eacute;nieur p&eacute;dagogique, j&rsquo;&eacute;labore des trames et con&ccedil;ois les cours de d&eacute;veloppement full-stack, d&rsquo;administrateur syst&egrave;mes et r&eacute;seaux, de Devops, de CDUI et de Data Engineer en respectant un triangle qualit&eacute;, co&ucirc;t, d&eacute;lai tr&egrave;s exigeant. Ce poste exige un panel de comp&eacute;tences large et une capacit&eacute; d&rsquo;apprentissage &eacute;lev&eacute;e.</p>\r\n<p>J&rsquo;ai g&eacute;r&eacute; la coordination d&rsquo;une petite &eacute;quipe de formateurs externes sur le programme CDA et dispens&eacute; des cours DWWM et CDA en PHP, JS, Svelte, React, NestJS et Laravel.</p>','\r',char(13)),'\n',char(10)),'','gdrci45k39b3j3m','Full remote',replace(replace('[\r\n  "docker",\r\n  "github",\r\n  "typescript",\r\n  "php",\r\n  "golang",\r\n  "ruby",\r\n  "python",\r\n  "react",\r\n  "pgsql",\r\n  "mysql",\r\n  "mongo"\r\n]','\r',char(13)),'\n',char(10)),'2022-04-25 12:00:00.000Z','Ingénieur pédagogique / Coordinateur / Formateur','O''Clock','2024-12-09 12:18:45.582Z');
